import React from "react";
import "./App.css";
import Header from "./Header";
import AddContact from "./AddContact";
import ContactList from "./ContactList";

function App() {
	const contacts = [
	{id:"1",
	nombre: "mama1",
	email: "email1@email.com",
	},
		{id:"2",
	nombre: "mama2",
	email: "email2@email.com",}
	];
  return (
    <div className="ui container">

		<Header />
		<AddContact />
		<ContactList />
	</div>
	);
}

export default App;
